import React from "react";
import "../styles/Projects.css";

import verificaCep from "/verifica-cep.jpg";
import serverest from "/serverest.png";
import portfolio from "/portfolio.jpg";
import todo from "/todo.jpg";

export default function Projects() {
  const projects = [
    {
      img: verificaCep,
      title: "Verifica CEP",
      description: "Aplica√ß√£o para consulta de CEP utilizando API ViaCEP.",
      link: "#"
    },
    {
      img: serverest,
      title: "ServeRest",
      description: "Simulador de API REST para testes de front-end.",
      link: "#"
    },
    {
      img: portfolio,
      title: "Portf√≥lio Pessoal",
      description: "O site que voc√™ est√° visitando agora! Feito com HTML, CSS e JavaScript.",
      link: "#"
    },
    {
      img: todo,
      title: "To-Do List",
      description: "Aplicativo simples para organiza√ß√£o de tarefas di√°rias.",
      link: "#"
    },
  ];

  return (
    <section className="projects" id="projetos">
      <h2 className="projects-title">
        <span>üíª</span> Meus <span className="highlight">Projetos</span>
      </h2>
      <div className="projects-container">
        {projects.map((project, index) => (
          <div className="card" key={index}>
            <img src={project.img} alt={project.title} />
            <div className="card-info">
              <h3>{project.title}</h3>
              <p>{project.description}</p>
              <a
                href={project.link}
                target="_blank"
                rel="noopener noreferrer"
                className="btn"
              >
                Ver Projeto
              </a>
            </div>
          </div>
        ))}
      </div>
    </section>
  );
}
